import initState from './reduce-abc';

export default function (state=initState, action){
  switch(action.type){
    case 'USER_SELECTED':
      return action.payload;
      break;
    case 'USER_REMOVED':
    const newState = state.filter( val => val !== action.name );
    return newState;
      break;
  }
  return state;
}
